import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const image1="././images/user-2.png";
const image2="././product-8.jpg";


ReactDOM.render(

  <>
  <h1>hello world</h1>
  <img src={image1} alt="title"/>
  <img src="././images/user-1.png" alt="image" className="image"/>
  </>,
  document.getElementById('root')
);
